import React from 'react';
import { NavLink } from 'react-router-dom';
import './Cart.scss';

export const Cart = () => (
  <NavLink className="Cart" to="/cart">

    <img
      className="Cart-Link"
      src="./img/cart.svg"
    />
    <span className="Cart-Count">{}</span>
  </NavLink>
)
